import React from "react";
import './founder.css';
import phanisir from '../images/phanisir.png'



function Founder() {
    return (
         <div>
            <img src={phanisir}/>
            <p>Aja Consulting Services LLP was founded in 2022 by Mr. Phaniraj Jaligama a serial entrepreneur and successful businessman along with Ms. Srilatha Kusumba, a software professional with 20+ years of experience. 
 Phaniraj jaligama, CEO comes with 25+ years of experience in diversified industries like Government, Administration, IT services, IT products and IT Captives. He has served in key roles in TCS, Cognizant and TIBCO software.  He has bootstrapped an IT services company and built it from 2 resources to 700+ resources in the capacity of CEO.  He is a motivational speaker and mentor. Phaniraj has done his Post Graduate Diploma in Business from Pune University.</p>
         </div>
    );
  }
  
  export default Founder;
